    "content":"\n\nドラえもんの「もしもボックス最強説」をくつがえしてください。 - Yahoo!知恵袋\n\nbmx_usoさん 「もしもボックス」は最強ではありません。 \nそもそももしもボックスは、注文の内容にもっとも近いパラレルワールドと現実を入れ替えるというものです。現実世界には何の影響もありませんし、「元の世界に」と言えば全てはパーになります。 \n注文の仕方も問題です。追加や変更はできないようですので（取り消してやり直す事は可能でしょうが）一度の注文で全ての条件を言い切らなければならないのです。…かな...\n ...",
